class Solution:
    def hasGroupsSizeX(self, deck: list) -> bool:
        deck = sorted(deck)
        statis = []
        min_count = 0x3f3f3f3f
        pre = deck[0]
        count = 0
        for num in deck:
            if num == pre:
                count += 1
            else:
                if count < min_count:
                    min_count = count
                statis.append(count)
                count = 1
                pre = num
        statis.append(count)
        if count < min_count:
            min_count = count
        if min_count < 2:
            return False
        factors = []
        for i in range(2, min_count+1):
            if min_count % i == 0:
                factors.append(i)
        
        for factor in factors:
            flag = True
            for count in statis:
                if count % factor != 0:
                    flag = False
                    break
            if flag and len(deck) % factor == 0:
                return True
        return False
    
